sources.sass\\component\\subcomponent\\menu-list:
.menu-list{
    list-style: none;
    position: absolute;
    width: 11rem;
    transform: scale(0);
    background-color: #fff;
    border: 1px solid #ccc;
    border-radius: 10px;
    overflow: hidden;
    transition: 200ms ease-in-out;
    transform-origin:top left;
    z-index: 9999;
    margin-top: 2rem;
    &.right{
        transform-origin: top right !important ;
        right: 0;
    }
    &.active{
        transform: scale(1);
    }
    li{
        margin-inline: 0 !important;
        border-bottom: 1px solid #ccc;
        padding-inline:1rem ;
        padding-block: 0.7rem !important;
        font-weight: 500 !important;
        width: 100%;
        transition: 350ms;
        &:last-child{
            border: none;
        }
        &:hover{
            background-color: rgba($color: #565656, $alpha: 0.7);
            a{
                color: white;
            }
        }
        &.active{
            background-color: #333333;
            a{
                color: white;
                font-weight: bold !important;
            }
        }
    }
}

sources.sass\\component\\navbar.scss:
@import "subcomponent/menu-list.scss";
@import "../utils/ripple.scss";
@import "../utils/dnones.scss";
.backdrop{
    position: fixed;
    inset: 0;
    background: rgba($color: #000000, $alpha: 0.6);
    transition: 350ms;
    visibility: hidden;
    z-index: 9997;
    opacity: 0;
    &.active{
        opacity: .5;
        visibility: visible;
    }
}
.navbar {
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 1rem 3rem !important;
    background-color: white;
    position: fixed;
    inset: 0 0 auto 0;
    @media (min-width:620px) {
        padding: 1rem 2rem;
    }
    &.border-1 {
        box-shadow: 0 2px 10px 1px lighten($color: #000000, $amount: 80%);
        z-index: 9999;
    }
    #{&}-brand{
        font-weight: bold;
        font-size: 1.9rem;
        color: black;
        display: flex;
        @media (min-width: 460px) {
            margin-left: 1rem;
        }
        
        &.active{
            display: none;
        }
    }
    .links{
        @media (max-width:980px) {
            display: none;
        }
        *{
            float: left;
        }
        li{
            list-style: none;
            font-weight: bold;
            font-family: 'Poppins';
            position: relative;
            margin-inline: 1rem;
            padding-block-end: 0.2rem;
            cursor: pointer;
            &:hover, &.active{
                &::before{
                    max-width: 100%;
                }
            }
            &::before{
                content: '';
               position: absolute;
               max-width: 0;
               inset: 90% 0 0 0 ;
               background-color: #f14d4d;
               transition: 450ms;
            }
            a{
                font-size: 1.2rem;
            }
        }
    }
    .search-bar{
        @media (max-width: 650px) {
            display: none;
        }
        font-family: TTCommons;
       border-radius: 10px;
       border: 1px solid #ccc; 
       font-weight: bold;
       font-size: 16px;
       padding: 0.8rem;
       max-width: 200px;
       padding-left: 3rem;
    }
    .search-icon{
        @media (max-width: 650px) {
            display: none;
        }
        position: absolute;
        left: 1.3rem;
        top: 0.8rem;
        color: #e9e9e9;
        font-size: 1.2rem !important;
    }
    
    .right-nav{
        @media (min-width: 460px) {
            margin-right: 1rem;
        }
        display: flex;
        align-items: center;
        column-gap: 1rem;;
        i{
            font-size: 1.6rem ;
            color: #696b6d;
        }
        .nav-button{
            padding: 0.6rem 1rem;
            font-family: 'Poppins';
            font-weight: bold;
            background-color: #565656;
            color: white;
            border: none;
            border-radius: 5px;
            &:active{
                background-color: darken($color: #565656, $amount: 20%);
            }
            &:hover{
                background-color: darken($color: #565656, $amount: 10%);
            }
        }
        .badge{
            position: absolute;
            background: darken($color: #696b6d, $amount: 30%);
            color: white;
            aspect-ratio: 1/1;
            width: 13px;
            height: 13px;
            font-size: 11px;
            text-align: center;
            vertical-align: middle;
            border-radius: 50% ;
            bottom: -2px;
            right: -5px;
        }
        
    }
}

sources.sass\\component\\subcomponent\\accordion:
.accordion{
    .accordion-head{
        background: white;
        border-bottom: 1px solid #ccc;
        border-top: 1px solid #ccc;
        display: flex;
        align-items: center;
        justify-content: space-between;
        padding: 1.2em 1.6em;
        font-weight: bold;
        font-size: 1.3rem;
        transition: 150ms;
        &:hover{
            background-color: lighten($color: #696b6d, $amount: 5%);
            color: white;
        }
        &.active{
            i{
                transform: rotate(180deg);
            }
            background-color: #565656;
            color: white;
        }
    }
    .accordion-body{
        max-height: 0;
        overflow: hidden;
        box-sizing: border-box;
        transition: 150ms ease-in-out;
        padding: 0 1.6em;
        
        &.active{
            padding: 1.2em 1.6em;
            max-height: 200px;
        }
        .accordion-item{
            width: 100%;
            padding: 1rem 1.5rem;
            font-family: 'Poppins';
            font-weight: 600;
            transition: 350ms;
            &:not(:last-child){
                border-bottom: 1px solid #ccc;
            }
            &:hover, &.active{
                background-color: #565656;
                color: white;
            }
        }
        
    }
}

sources.sass\\utils\\ripple.scss:
span.ripple{
    width: 1rem;
    aspect-ratio: 1/1;
    transform: scale(0);
    border-radius: 50%;
    position: absolute;
    animation: large 600ms linear;
    background-color:var(--color);
    opacity: 0.7;
}
@keyframes large {
    to{
        transform: scale(var(--size));
        opacity: 0;
    }   
}

sources.sass\\component\\sidebar.scss:
@import "subcomponent/accordion.scss";
@import "../utils/ripple.scss";
.sidebar{
    width: 330px;
    height: 100vh;
    position: fixed;
    top: 10px;
    transition: 500ms ease-in-out;
    margin-top: 4.5rem;
    box-shadow: 3px 0 10px 1px lighten($color: #000000, $amount: 70%);
    background-color: white;
    @media (max-height: 862px){
        overflow-y:auto ;
        padding-block-end: 10rem;
    }
    
        transform: translateX(-100%);
        z-index: 9998;
        
        &.active{
            transform: translateX(0) !important;
        }
    
    
    .sidebar-item{
        .box{
            padding: 1rem;
            color: white;
            .text{
                margin-left: 3rem;
                text-align: justify;
                position: relative;
                z-index: 2;
            }
            .title{
                position: relative;
                z-index: 2;
                .iconbox{
                    background-color: #ff8a4a;
                    width: fit-content;
                    padding: 0.6rem;
                    aspect-ratio: 1/1;
                    border-radius: 5px;
                    font-size: 20px;
                    display: inline-block;
                    margin-right: 0.6rem;
                }
                font-weight: bold;
                font-size: 20px;
            }
            &.black{
                background-color: #333333;
                position: relative;
            }
            &.blue{
                background-color: #2bd5eba8;
                position: absolute;
                inset: 0;
                clip-path: circle(35% at 0 85%);
                z-index: 1;
            }
            &.orange{
                background-color: #565656;
                position: absolute;
                inset: 0;
                clip-path: circle(30% at 90% 95%);
                z-index: 1;
            }
        }
        border-top: 1px solid #ccc;
        padding: 1.7rem 2rem;
        &-title{
            margin-bottom: 1rem;
            font-weight: bold;
            font-size: 1.4rem;
        }
      
    }
    
}

sources.sass\\cart.scss:
@import url("https://fonts.googleapis.com/css2?family=Poppins:wght@200;300;400;500;600;700;800;900&display=swap");
@import "utils/reset.scss";
@import "component/navbar.scss";
@import "component/sidebar.scss";
:root{
  @media (max-width:1050px) {
    font-size: 14px;
  }
}
.flex{
  display: flex;
  align-items: center;
  flex-direction: column;
}
form{
  position: relative;
}
.barco72{
  width: min(90vw, 1800px);
  overflow-x: auto;
  display: flex;
  justify-content: center;
  flex-direction:column ;
  align-self: center;
  table {
    width: max(90vw, 800px);
    height: 300px;
    min-height: 200px;
    margin-left: auto !important;
    margin-right: auto !important;
    margin-top: 1rem !important;
    font-family: "Poppins" !important;
    border-collapse: collapse;
   
    td {
      border-bottom: solid #b8b8b8 2px;
      font-size: 1.3rem;
      .kuantiti {
        border: #dfdfdf solid 1px;
        border-radius: 4px;
        width: 25px;
        height: 25px;
      }
      li {
        list-style: none;
      }
    }
  }
  
}
h1{
  margin-top: 6rem !important;
  font-size: 3rem;
}

.tombol {
  position: absolute;
  right: 0;
  margin-right: auto !important;
  margin-top: 100px !important;
  font-family: "Poppins" !important;
  color: white;
  background-color: #252525;
  border-radius: 5px;
  border: none;
  padding: 10px !important;
  font-size: medium;
}
.tombol:hover {
  background-color: #3a3a3a;
  border-radius: 5px;
  border: none;
}
